    fLastX = x;
    fLastY = y;
    if (e.isShiftDown()) {
        view().toggleSelection(fAnchorFigure);
        fAnchorFigure = null;
    } else if (!view().isFigureSelected(fAnchorFigure)) {
        view().clearSelection();
        view().addToSelection(fAnchorFigure);
    }
}

/**
