 */
public synchronized void lock() {
    // recursive lock
    Thread current = Thread.currentThread();
    if (fDrawingLockHolder == current) {
        return;
    }
    while (fDrawingLockHolder != null) {
        try {
            wait();
        } catch (InterruptedException ex) {
        }
    }
    fDrawingLockHolder = current;
}

